import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';



export default function Dashboard() {
    return (
        <Stack
        direction={{ xs: 'column', sm: 'row' }}
        spacing={{ xs: 1, sm: 2, md: 4 }}
      >
        <Item>Item 1</Item>
        <Item>Item 2</Item>
        <Item>Item 3</Item>
      </Stack>
    );
  }
